  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('夏福特/杀戮战警2/夏福特之子/铁杆神探2  ','/images/movie/b68c6c5d8eb7426a4088a895ed6ac17c.jpg','杰西·厄舍加盟[杀戮战警]续作[夏福特之子](Son of Shaft，暂译)，塞缪尔·杰克逊同时回归','亚历山德拉·希普 Alexandra Shipp  ,阿万·乔贾 Avan Jogia  ,雷吉娜·赫尔 Regina Hall  ,勒达·卡代布 Reda Kateb ,葆拉·贝尔 Paula Beer , 马索·曼恩 Method Man , 马索·曼恩 Method Man ','2019-5-11 10:00:00','2019-7-11 10:00:00',3.4)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('阿丽塔：战斗天使/艾莉塔：战斗天使(台)/铳梦/铳梦：战斗天使(港)  ','/images/movie/Em0TU.jpg','故事发生在遥远的26世纪，外科医生依德（克里斯托弗·瓦尔兹 Christoph Waltz 饰）在垃圾场里捡到了只剩下头部的机械少女将她带回家中，给她装上了本来为自己已故的女儿所准备的义体，并取名阿丽塔','克里斯托弗·沃尔兹 Christoph Waltz ,基恩·约翰逊 Keean Johnson  ,艾德·斯克林 Ed Skrein ,勒达·卡代布 Reda Kateb ,葆拉·贝尔 Paula Beer , 山姆·麦地那 Sam Medina ,　比利·布莱尔 Billy Blair ','2019-5-11 10:00:00','2019-7-11 10:00:00',8.4)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('明日传奇 第四季  DC明日传奇  ','/images/movie/EmYkQ.jpg','《明日传奇》即将播出的第四季曝光预告片，从穿越去美国大西部，到遇见巨大的蓝色填充玩具，剧情脑洞大开，同时，DC漫画的魔鬼猎手康斯坦丁升为常规主演。第四季将在10月22日首播','布兰登·罗斯 Brandon Routh ,奥玛·希 Omar Sy ,马修·卡索维茨 Mathieu Kassovitz ,勒达·卡代布 Reda Kateb ,葆拉·贝尔 Paula Beer , 马特·瑞安 Matt Ryan ,Ian Hawes ','2019-5-11 10:00:00','2019-7-11 10:00:00',1.4)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES('Alita: Battle Angel', '/images/movie/Battle Angel.jpg','故事发生在遥远的26世纪，外科医生依德（克里斯托弗·瓦尔兹 Christoph Waltz 饰）在垃圾场里捡到了只剩下头部的机械少女将她带回家中，给她装上了本来为自己已故的女儿所准备的义体，并取名阿丽塔（罗莎·萨拉扎尔 Rosa Salazar 饰）。苏醒后的阿丽塔对这个五彩斑斓但却暴力而又残酷的世界产生了浓厚的兴趣，在结识了青年雨果（基恩·约翰逊 Keean Johnson 饰）后，阿丽塔开始接触名为机动球的运动，并在比赛中展现出了惊人的格斗天赋。 在废铁城居民们的头顶，漂浮着巨大的浮空城市撒冷，废铁城居民们的一切劳作和付出，都是为了给撒冷提供继续运作的燃料。在大财阀维克特（马赫沙拉·阿里 Mahershala Ali 饰）所设立的机动球比赛中，最终获得冠军的人能够获得前往撒冷生活的资格，阿丽塔决定利用自己的格斗天赋参加比赛，却被卷入了一个巨大的阴谋之中。','罗莎·萨拉查 Rosa Salazar ,克里斯托弗·沃尔兹 Christoph Waltz ,基恩·约翰逊 Keean Johnson ,艾德·斯克林 Ed Skrein ','2019-02-05 10:00:00','2019-7-11 10:00:00', 6.4)",    
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES('The Best of Enemies', '/images/movie/best.jpg','STXfilms拿下塔拉吉·P·汉森和山姆洛·克威尔主演新片《最佳敌人》(The Best of Enemies)的北美发行权，Babou Ceesay(《侠盗一号》)、安妮·海切(《危险机密》)、韦斯·本特利(《美国恐怖故事》)、布鲁斯·麦克吉尔(《妙女神探》)、小约翰·加拉赫、尼克·西塞等参演。制片人罗宾·比塞尔(《饥饿游戏》《琼斯的自由国度》)首执导筒，并根据Osha Gray Davidson所著书籍改编剧本。 汉森饰演北卡罗来纳州达勒姆的民权活动家Ann Atwater，与3K党领导者C.P. Ellis(洛克威尔)进行了为时10年的斗争，直到1971年，两人同意共同主持一个为期两周的社区会议，以应对法院命令的学校废除种族隔离法令。这场会议改变了他们的生活.','塔拉吉·P·汉森 Taraji P. Henson ,山姆·洛克威尔 Sam Rockwell ,巴布·塞赛 Babou Ceesay ,尼克·西塞 Nick Searcy ','2019-04-05 10:00:00','2019-7-11 10:00:00', 8.4)",    
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES('Teen Spirit ', '/images/movie/teen.jpg','范宁扮演的一个来自欧洲小镇害羞女孩，梦想自己可以成为一名流行歌手，幸运的是在一个导师的帮助下，她逐渐接近了自己梦想。 ','艾丽·范宁 Elle Fanning ,丽贝卡·豪尔 Rebecca Hall ,米莉·布拉迪 Millie Brady ,伊丽莎白·贝林顿 Elizabeth Berrington','2018-09-07 10:00:00','2018-10-11 10:00:00', 6.4) ",    
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES('Of Fathers and Sons/Kinder des Kalifats ', '/images/movie/son.jpg','塔拉勒·德克回到了他的家乡，在那里他获得了一个激进的伊斯兰家庭的信任，并分享他们的日常生活长达两年多。他的照相机提供了一种极为罕见的洞察，了解在伊斯兰哈里发长大意味着什么,'阿布·乌萨马 Abu Osama ,艾曼·乌萨马 Ayman Osama ,乌萨马·乌萨马 Osama Osama ','2017-11-05 10:00:00','2017-7-11 10:00:00', 7.2) ",    
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES('反贪风暴4/P风暴 ', '/images/movie/storm.jpg','廉政公署收到报案人廖雨萍（周秀娜饰）的实名举报，举报正在坐牢的富二代曹元元（林峯饰）涉嫌行贿监狱里的监督沈济全（谭耀文饰）以及惩教员，首席调查主任陆志廉（古天乐饰）决定深入虎穴，卧底狱中。在监狱里，被陆志廉送入监狱的前警司黄文彬（林家栋饰）以及曹元元两大帮派势成水火，陆志廉趁机接近曹元元取得信任。同时监狱外的廉政公署总调查主任程德明（郑嘉颖饰）、国内反贪局行动处处长洪亮（丁海峰饰）也陆港联手，通力合作，最终成功破获贪腐行贿大案。','古天乐 Louis Koo ,郑嘉颖 Kevin Cheng ,林峯 Raymond Lam ,林家栋 Ka Tung Lam ','2019-04-04 10:00:00','2019-7-11 10:00:00',9.4)",
  "insert into movie(`name`, `imgUrl`, `describe`, `actor`, `start_time`, `end_time`, `score`) VALUES('女哭声/夜半鬼哭声(台) ', '/images/movie/0ee0516a80f0ccd48294c3101622e1ad.jpg', '孙娜恩有望出演电影《女哭声》，经纪公司表示只是收到的出演提案，尚未确定。《女哭声》为1986年的一部经典恐怖片，之前李宥英也收到了出演提案，目前不知道是不是同一个角色。 ', '孙娜恩 Na-Eun Son ,徐英姬 Yeong - hie Seo ', '2019-8-11 10:00:00', '2019-9-11 10:00:00', 3.4)",
  "insert into movie(`name`, `imgUrl`, `describe`, `actor`, `start_time`, `end_time`, `score`) VALUES('地狱男爵：血皇后崛起/地狱怪客：血后的崛起(台)', '/images/movie/3ce81c50464a00ff95713f1080ddd460.jpg', '地狱男爵是二战期间被纳粹召唤到人间的恶魔之子，在被布鲁姆教授收养长大后逐渐学会了融入人类世界，成为了一名超自然力量调查员，然而一起关于末世的预言，令他陷入重重危机。与此同时，史上最强大的邪恶女巫血皇后正企图打破封印重返人间，并让瘟疫席卷地球。地狱男爵与通灵少女爱丽丝以及上校本·戴米奥，因此共同踏上了阻止血皇后的征程', '米拉·乔沃维奇 Milla Jovovich ,金大贤 Daniel Dae Kim ,伊恩·麦柯肖恩 Ian McShane ,阿利斯泰·皮垂 Alistair Petrie ,萨莎·莱恩 Sasha Lane ,托马斯·哈登·丘奇 Thomas Haden Church ,佩内洛普·米契尔 Penelope Mitchell 苏菲·奥康内', '2019-5-11 10:00:00', '2019-8-11 10:00:00', 4.8)",
  "insert into movie(`name`, `imgUrl`, `describe`, `actor`, `start_time`, `end_time`, `score`) VALUES('夏福特/杀戮战警2/夏福特之子/铁杆神探2 ', '/images/movie/Em0TU.jpg', '杰西·厄舍加盟[杀戮战警]续作[夏福特之子](Son of Shaft，暂译)，塞缪尔·杰克逊同时回归。本片由蒂姆·斯托瑞([佐州自救兄弟])执导，肯尼亚·巴里斯编剧。厄舍扮演杰克逊的儿子，他同时也是一名联邦调查局工作人员，更是网络专家。 ', '塞缪尔·杰克逊 Samuel L. Jackson ,亚历山德拉·希普 Alexandra Shipp ,阿万·乔贾 Avan Jogia ,雷吉娜·赫尔 Regina Hall ,马索·曼恩 Method Man ,马特·劳里亚 Matt Lauria ,杰西·厄舍 Jessie Usher ,理查德·朗德特依 Richard Roundtree ,伊恩·卡塞尔伯里 Ian Cass', '2019-8-11 10:00:00', '2019-12-11 10:00:00', 7.4)",
  "insert into movie(`name`, `imgUrl`, `describe`, `actor`, `start_time`, `end_time`, `score`) VALUES('恐怖分子的孩子/恶魔的育成(港)/父子之间', '/images/movie/989dcc22ad79cfe5f6210cac7c464ad8.jpg', '塔拉勒·德克回到了他的家乡，在那里他获得了一个激进的伊斯兰家庭的信任，并分享他们的日常生活长达两年多。他的照相机提供了一种极为罕见的洞察，了解在伊斯兰哈里发长大意味着什么。 ', '阿布·乌萨马 Abu Osama ,艾曼·乌萨马 Ayman Osama ,乌萨马·乌萨马 Osama Osama', '2019-8-11 10:00:00', '2019-10-11 10:00:00', 5.4)",
  "insert into movie(`name`, `imgUrl`, `describe`, `actor`, `start_time`, `end_time`, `score`) VALUES('恶人传/极恶对决(台)', '/images/9637413a09721eb54e8a6d40db68efb8.jpg', '电影《恶人传》讲述的是偶然间成为连锁杀人魔的目标后复活的组织老板张东秀（马东锡 饰）和为了抓住法人而疯狂展开暴力反刑警郑泰锡（金武烈 饰）之间的无法妥协，和为了抓住连锁杀人魔K而展开的故事的犯罪动作大片。 ', '马东锡 Tong-Seok Ma ,金武烈 Moo - yeol Kim,金成圭 Seong - gyoo Kim,刘承睦 Yoo Seung - Mok,崔民哲 Min - cheol Choi,金胤成 Kim Yoon - seong,许栋元 Heo Dong - won,吴熙俊 Hee - joon Oh,杨志洙 Ji - soo Yang,金桀 Kim Kyoul', '2018-8-11 10:00:00', '2018-10-11 10:00:00', 8.4)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('入铁笼','/images/movie/We Are Legends.jpg','哥哥『招积』和弟弟『电兔』在孤儿院长大，经院工『雷Sir』领养并得到『雷师母』的帮忙，入住乡村拳馆。招积供养着弟弟到学校读书，但电兔打地下拳赚钱，被开除学籍，两兄弟因而反目。电兔成为网络红人。他极速KO对手的片段被网友封为『烂仔交王』。招积每天勤练拳并参加各大小型比赛，打出59场不败记录！招积首场MMA职业拳赛，竟然被20秒KO，及后对手陈乐风在台上更侮辱雷师母和乡村拳馆。及后，网络却疯传『烂仔交王』电兔为了哥哥挑战『万人迷』陈乐风的片段。两兄弟回想起当年在孤儿院的日子，忍不住流下泪来。哥哥说电兔有一个罕有的天赋，就是判断对手拳法的能力 ','林耀声 Yiu-Sing Lam ','2019-5-11 10:00:00','2019-7-11 10:00:00',3.4)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('女哭声','/images/movie/The Wrath.jpg','孙娜恩有望出演电影《女哭声》，经纪公司表示只是收到的出演提案，尚未确定。《女哭声》为1986年的一部经典恐怖片，之前李宥英也收到了出演提案，目前不知道是不是同一个角色。',' 孙娜恩 Na-Eun Son,徐英姬 Yeong-hie Seo','2018-11-11 10:00:00','2019-7-11 10:00:00',6.5)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('完美的他人','/images/movie/Intimate Strangers.jpg','本片翻拍自2016年在意大利上映的同名电影，讲述4对多年朋友夫妇聚会吃晚饭，为了确认彼此到底有多了解，决定玩游戏相互说出秘密和心事，由此关系发生波动','林耀声 Yiu-Sing Lam ,林耀声 Yiu-Sing Lam, 文松 Song Wen, 吴志雄 Chi Hung Ng, 衣云鹤 Yunhe Yi, Feynman','2019-7-11 10:00:00','2019-3-11 10:00:00',3.4)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('美杜莎的吻','/images/movie/Inhuman Kiss.jpg','在一个偏远的村庄里，住着一个天真善良的女孩儿Sai，有一天她发现自己继承了女鬼krasue的诅咒，一到晚上，她的头会与躯体分离并捕食村里的牲畜，村民见牲畜死状离奇，便猜测是女鬼krasue干的，村民打算杀掉Sai，深爱着Sai的Jerd和Noi决定帮助她战胜诅咒',' 抔米提·米弯投瓦兰 Oabnithi Wiwattanawarang,萨哈贾克·波斯安吉特 Sahajak Boonthanakit ','2018-9-11 10:00:00','2019-7-11 10:00:00',9.0)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('恶人传','/images/movie/The Cop.jpg','电影《恶人传》讲述的是偶然间成为连锁杀人魔的目标后复活的组织老板张东秀（马东锡 饰）和为了抓住法人而疯狂展开暴力反刑警郑泰锡（金武烈 饰）之间的无法妥协，和为了抓住连锁杀人魔K而展开的故事的犯罪动作大片','马东锡 Tong-Seok Ma ,金成圭 Seong-gyoo Kim, , Feynman','2019-5-11 10:00:00','2019-7-11 10:00:00',3.4)",
  
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('阿丽塔：战斗天使BD中英双字幕 2019年科幻动作','/images/movie/Alita_Battle_Angel.jpg','故事发生在遥远的26世纪，外科医生依德（克里斯托弗·瓦尔兹 Christoph Waltz 饰）在垃圾场里捡到了只剩下头部的机械少女将她带回家中，给她装上了本来为自己已故的女儿所准备的义体，并取名阿丽塔（罗莎·萨拉扎尔 Rosa Salazar 饰）。苏醒后的阿丽塔对这个五彩斑斓但却暴力而又残酷的世界产生了浓厚的兴趣，在结识了青年雨果（基恩·约翰逊 Keean Johnson 饰）后，阿丽塔开始接触名为机动球的运动，并在比赛中展现出了惊人的格斗天赋。 在废铁城居民们的头顶，漂浮着巨大的浮空城市撒冷，废铁城居民们的一切劳作和付出，都是为了给撒冷提供继续运作的燃料。在大财阀维克特（马赫沙拉·阿里 Mahershala Ali 饰）所设立的机动球比赛中，最终获得冠军的人能够获得前往撒冷生活的资格，阿丽塔决定利用自己的格斗天赋参加比赛，却被卷入了一个巨大的阴谋之中。','罗莎·萨拉查 Rosa Salazar,克里斯托弗·沃尔兹 Christoph Waltz,基恩·约翰逊 Keean Johnson,艾德·斯克林 Ed Skrein,马赫沙拉·阿里 Mahershala Ali, 詹妮弗·康纳利 Jennifer Connelly,杰基·厄尔·哈利 Jackie Earle Haley  ','2019-02-05 10:00:00','2019-02-22 12:00:00', 7.5)",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('反贪风暴4/P风暴','/images/movie/P_storm.jpg','廉政公署收到报案人廖雨萍（周秀娜饰）的实名举报，举报正在坐牢的富二代曹元元（林峯饰）涉嫌行贿监狱里的监督沈济全（谭耀文饰）以及惩教员，首席调查主任陆志廉（古天乐饰）决定深入虎穴，卧底狱中。在监狱里，被陆志廉送入监狱的前警司黄文彬（林家栋饰）以及曹元元两大帮派势成水火，陆志廉趁机接近曹元元取得信任。同时监狱外的廉政公署总调查主任程德明（郑嘉颖饰）、国内反贪局行动处处长洪亮（丁海峰饰）也陆港联手，通力合作，最终成功破获贪腐行贿大案。','古天乐 Louis Koo,郑嘉颖 Kevin Cheng,林峯 Raymond Lam ,林家栋 Ka Tung Lam,周秀娜 Chrissie Chaw,张智霖 Julian Cheung,谭耀文 Patrick Tam, 张继聪 Louis Cheung,蔡瀚亿 Babyjohn Choi','2019-04-04 10:00:00' ,'2019-07-11 12:00:00',9.9)",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('野马' ,'/images/movie/The_Mustang.jpg','法国导演Laure de Clermont-Tonnerre(《纯真曲》《追忆似水年华》)执导并同Mona Fastvold(《战前童年》《梦游者》)和Brock Norman Brock(《国境卫士》《布朗森》)编写剧本，已于内华达开拍。修奈尔饰演一名暴力罪犯Roman Coleman，得到了参与一项康复治疗程序的机会，其中包括训练野蛮的野马。斯图沃特饰演Coleman的狱友，萨兰登饰演监狱的治疗专家，艾朵饰演Coleman的女儿。','马提亚斯·修奈尔 Matthias Schoenaerts,杰森·米切尔 Jason Mitchell,布鲁斯·邓恩 Bruce Dern ','2019-03-15 10:00:00','2019-07-11 12:00:00', 7.3)",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('飞驰人生' ,'/images/movie/Pegasus.jpg','曾经在赛车界叱咤风云、如今却只能经营炒饭大排档的赛车手张驰（沈腾饰）决定重返车坛挑战年轻一代的天才。然而没钱没车没队友，甚至驾照都得重新考，这场笑料百出不断被打脸的复出之路，还有更多哭笑不得的窘境在等待着这位过气车神…… ','沈腾 Teng Shen ,　黄景瑜 Johnny Huang ,　尹正 Zheng Yin ,　张本煜 Benyu Zhang ,　尹昉 Fang Yin ','2019-02-05 10:00:00','2019-07-11 12:00:00',6.4)",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('江湖儿女/灰烬是最洁白的/金钱与爱情','/images/movie/Ash_is_Purest.jpg','故事开始于2001年的山西大同，巧巧（赵涛 饰）和斌斌（廖凡 饰）相恋多年，巧巧一心希望能够和斌斌成家过安稳的生活，但斌斌身为当地的大佬，有着自己更高远的志向。一场意外中，斌斌遭人暗算危在旦夕，巧巧拿着斌斌私藏的手枪挺身而出救了斌斌，自己却因为非法持枪而被判处了五年的监禁。一晃眼五年过去，出狱后的巧巧发现整个世界都发生了翻天覆地的变化，唯一不变的是她对斌斌真挚的感情。巧巧跋山涉水寻找斌斌的下落，但此时的斌斌早已经失去了往日的锋芒，而且身边已有了新的女友。身无分文的巧巧靠着自己的智慧摸爬滚打，终于为自己挣得了一片天地。','赵涛 Tao Zhao ,廖凡 Fan Liao ,徐峥 Zheng Xu ,梁嘉艳 Casper Liang,　刁亦男 Yi'nan Diao,张一白 Yibai Zhang ','2018-05-11 10:00:00','2018-09-21 12:00:00', 7.6)",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('蜜蜂总动员','/images/movie/bee.jpg','怎么说呢？任何族群里都会出现那么一两个异类，即便是整日劳作的小蜜蜂，也有走出蜂箱看世界的时候。相信你在看过了这部极具颠覆意义','杰瑞·宋飞,芮妮·齐薇格,马修·布罗德里克,约翰·古德曼','2007-07-11 10:00:00','2007-07-11 12:00:00',9.5) ",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('决胜21点','/images/movie/determine.jpg','这是一个将智慧奉为美德的故事，围绕着6名来自于麻省理工学院的高材生展开，改编自一个真实的事件：这6位学生在一位数学教授的指导下，跑到拉斯维加斯的赌场，通过21点牌技卷走了接近于天文数字的数百万美金，从而也让自己身陷在了危机当中。','吉姆·斯特加斯,凯文·史派西,凯特·波茨沃斯,劳伦斯·菲什伯恩','2007-07-12 8:00:00','2007-07-12 10:00:00',8.6) ",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('奇幻人生','/images/movie/fantasy.jpg','剧情：“杀死”哈罗德·克雷克,看点：天马行空的小说人生,其它： 真实比小说更奇幻','威尔·法瑞尔,马吉·盖伦哈尔,达斯丁·霍夫曼,奎恩·拉提法','2007-07-12 11:00:00','2007-07-12 12:00:00',9.5) ",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('美国狼人在伦敦','/images/movie/werewolf.jpg','两个美国青年在英格兰北部的沼泽地里遭到一个狼人的袭击。其中一个不幸身亡，另一个被当地村民所救。被救的青年叫戴维·凯斯勒，自从遭狼人袭击后，他经常被恶梦中的幽灵所纠缠，而且，每当天上出现满月的时候，他都要变态杀人。然而，他自己对这一切似乎并不知晓。直到有一天，他读到一份布告，才意识到最近发生的这一连串残杀事件都应由他负责。','Sean Baker,Claudine Bowyer,Joe Belcher,Joe Belcher','2007-07-13 8:00:00','2007-07-13 10:00:00',9.1) ",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('天魔3','/images/movie/monty.jpg','撒旦化身己长大成人，他不但控制了一跨国企业，更在政坛大展拳脚，务求控制全世界。另一方面，耶稣的化身再临人世，正邪大战一触即发?到底谁能赢得最终胜利。','山姆·尼尔,Rossano Brazzi,Don Gordon,Lisa Harrow','2007-07-13 11:00:00','2007-07-13 12:00:00',8.7) ",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('夏福特/杀戮战警2/夏福特之子/铁杆神探2','/images/movie/c_img1.jpg','杰西·厄舍加盟[杀戮战警]续作[夏福特之子](Son of Shaft，暂译)，塞缪尔·杰克逊同时回归。本片由蒂姆·斯托瑞([佐州自救兄弟])执导，肯尼亚·巴里斯编剧。厄舍扮演杰克逊的儿子，他同时也是一名联邦调查局工作人员，更是网络专家。','塞缪尔·杰克逊 Samuel L. Jackson ,亚历山德拉·希普 Alexandra Shipp ,阿万·乔贾 Avan Jogia ,雷吉娜·赫尔 Regina Hall ,马索·曼恩 Method Man ,马特·劳里亚 Matt Lauria ,Maiya Boyd ','2019-06-29  ','2019-07-29',9.6)",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('卧底罗密欧/卧底特务 ','/images/movie/c_img2.jpg','1971年一名遇难陆军少校之子被印度调查分析局发掘，在战前作为卧底安插在巴基斯坦','约翰·亚伯拉罕 John Abraham ,杰奇·史洛夫 Jackie Shroff ,Mouni Roy ,Suchitra Krishnamoorthi ,Sikander Kher ,','2019-09-29  ','2019-10-29',9.6)",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('如意天书  ','/images/movie/c_img3.jpg','本剧改编自罗贯中明代小说《平妖传》。影片《如意天书》讲述了在北宋年间，三只形态各异、各有想法的狐妖意欲抢夺天书修炼成仙，进而缠上了拥有天书的人类蛋生，而蛋生此时对于自己的使命还一无所知。在与三只狐妖的纠缠过程中，蛋生也在逐渐的成长，并且与狐妖媚儿之间产生了意难平的情愫，最终上演了一场感天动地的唯美奇幻虐恋。','陈信喆 Xinzhe Chen ,姜萌轩 Mengxuan Jiang ,李菁 Jing Li ,崔可 Ke Cui ,','2019-6-29  ','2019-7-10',8.7)",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('假期惊魂  ','images/movie/c_img5.jpg','本片讲述一对夫妇在山上遭遇自行车团伙的攻击并最终摆脱危险的故事。','宝拉·巴顿 Paula Patton ,威廉·菲德内尔 William Fichtner ,米西·派勒 Missi Pyle ,道恩·奥利弗瑞 Dawn Olivieri ,罗塞莉·桑切斯 Roselyn Sánchez ,鲁克·高斯 Luke Goss ,欧玛·艾普斯 Omar Epps ','2019-15-29 8:00:00 ','2019-18-18 8:00:00',7.7)",
  "insert into movie (`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('女哭声/夜半鬼哭声(台) ','/images/movie/c_img4.jpg','孙娜恩有望出演电影《女哭声》，经纪公司表示只是收到的出演提案，尚未确定。《女哭声》为1986年的一部经典恐怖片，之前李宥英也收到了出演提案，目前不知道是不是同一个角色。','孙娜恩 Na-Eun Son, 徐英姬 Yeong-hie Seo ,','2019-15-29 8:00:00 ','2019-18-18 8:00:00',7.7)",
  "insert into movie(`name`, `imgUrl`, `describe`, `actor`, `start_time`, `end_time`, `score`)VALUES('洗罪','/images/movie/GF_1.jpg','影片讲述了在时局黑暗的民国天津，一名正义的警 察郭翀，卷入了天津卫两大势力钱家与三才帮的争斗，并最终找回他护国安民、打击罪恶信仰的故事。','孙一明 Yiming Sun ,黄垲翔 Kaixiang Huang ,高天景 Tianjing Gao ,杨棕喆 ZongZhe Yang ,彭娜齐 Nati Peng','2019-06-06 10:00:00','2019-06-16 10:00:00',9.1)",
  "insert into movie(`name`, `imgUrl`, `describe`, `actor`, `start_time`, `end_time`, `score`)VALUES('镇魔司：苍龙觉醒','/images/movie/GF_2.jpg','影片讲述了在赵王朝元武十七年，仙师降灵打破四百年历任传统，即将迎来六百高寿。因呼声盖过当朝天子，皇帝震怒，欲将之铲除。镇魔司张谦派明、暗两部兵分量两路上玉虚山，明监负责打探消息，暗监负责刺杀仙师降灵。两部人员宿来不和，矛盾累计颇多，此番相遇必有一番龙争虎斗。','张亚奇 Yaqi Zhang ,赵帅 Shuai Zhao ,钟政均 Zhengjun Zhong ,曹玥瑶 Yueyao Cao ,夏茉 Mo Xia ,何若鹤 Ruohe He','2019-06-20 10:00:00','2019-06-30 10:00:00',9.8)",
  "insert into movie(`name`, `imgUrl`, `describe`, `actor`, `start_time`, `end_time`, `score`)VALUES('人间·喜剧','/images/movie/GF_3.jpg','平凡夫妻濮通（艾伦饰）和米粒（王智饰）因被公司拖欠工资导致交不起房租；富二代杨小伟（鲁诺饰）不被亲爹宠爱，欠下巴爷（任达华饰）一笔巨款无处偿还。被钱逼到绝路的三人相遇，索性上演了一出富二代绑架案，一路认怂的夫妻变身假绑匪，最穷富二代变身假人质……一番折腾下，杨小伟的首富爸爸杨台竣（金士杰饰）最终承诺了1000万的“赎金”。但事情远不止这么简单，狡猾的杨台竣并不想真的付钱，黑帮老大巴爷也气势汹汹上门要债。面对大佬们的四面夹击，濮通、米粒和杨小伟三人会如何应对？','艾伦 Allen,王智 Zhi Wang,鲁诺 Nuo Lu,任达华 Simon Yam,金士杰 Shih-Chieh King,潘斌龙 Binlong Pan,周显欣 Xianxin Zhou,九孔 Kong Jiu,董立范 Lifan Dong,史航 Hang Shi,罗京民 Jingmin Luo','2019-07-01 10:00:00','2019-07-30 10:00:00',9.5)",
  "insert into movie(`name`, `imgUrl`, `describe`, `actor`, `start_time`, `end_time`, `score`)VALUES('如意天书','/images/movie/GF_4.jpg','本剧改编自罗贯中明代小说《平妖传》。影片《如意天书》讲述了在北宋年间，三只形态各异、各有想法的狐妖意欲抢夺天书修炼成仙，进而缠上了拥有天书的人类蛋生，而蛋生此时对于自己的使命还一无所知。在与三只狐妖的纠缠过程中，蛋生也在逐渐的成长，并且与狐妖媚儿之间产生了意难平的情愫，最终上演了一场感天动地的唯美奇幻虐恋。','陈信喆 Xinzhe Chen ,姜萌轩 Mengxuan Jiang ,李菁 Jing Li ,崔可 Ke Cui ','2019-05-25 10:00:00','2019-06-15 10:00:00',9.3)",
  "insert into movie(`name`, `imgUrl`, `describe`, `actor`, `start_time`, `end_time`, `score`)VALUES('七品神探 ','/images/movie/GF_5.jpg','《七品神探》故事讲述了明英宗正统年间府衙推官赵铭久不畏权贵，秉公执法，屡破奇案的历程。全片通过一系列看似零散的小故事把赵铭久武艺高强，刚正不阿，神勇机智，忠于职守的形象特点展现在观众面前。','夏凡 Fan Xia ,赵雅萍 Yaping Zhao ,雪村 Cun Xue ,赵海燕 Haiyan Zhao ','2019-04-25 10:00:00','2019-03-29 10:00:00',9.1)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('我们一直住在城堡里','/images/movie/yizhizaochengbaoli.jpg','塞巴斯蒂安·斯坦加盟独立制作惊悚片《古堡惊魂》(We Have Always Lived in the Castle，暂译)，卡司包括威廉·达福、泰莎·法米加、亚历珊德拉·达达里奥等。影片由斯黛茜·帕森自编自导，故事改编自雪莉·杰克逊同名恐怖小说，围绕一户神秘家庭中发生的离奇死亡事件展开。影片将在都柏林拍摄。','塞巴斯蒂安·斯坦 Sebastian Stan ,泰莎·法米加 Taissa Farmiga, 亚历珊德拉·达达里奥 Alexandra Daddario, 克里斯平·格洛弗 Crispin Glover, 斯蒂芬·霍根 Stephen Hogan, Feynman, 葆拉·马尔科姆森 Paula Malcomson, 彼特·奥梅拉 Peter OMeara','2019-5-11 10:00:00','2019-7-11 10:00:00',5.8)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('洗罪','/images/movie/xizui.jpg','影片讲述了在时局黑暗的民国天津，一名正义的警 察郭翀，卷入了天津卫两大势力钱家与三才帮的争斗，并最终找回他护国安民、打击罪恶信仰的故事。','孙一明 Yiming Sun ,黄垲翔 Kaixiang Huang , 高天景 Tianjing Gao , 杨棕喆 ZongZhe Yang, 彭娜齐 Nati Peng ','2019-2-11 10:00:00','2019-7-11 10:00:00',6.9)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('美杜莎之吻','/images/movie/dulisha.jpg','　在一个偏远的村庄里，住着一个天真善良的女孩儿Sai，有一天她发现自己继承了女鬼krasue的诅咒，一到晚上，她的头会与躯体分离并捕食村里的牲畜，村民见牲畜死状离奇，便猜测是女鬼krasue干的，村民打算杀掉Sai，深爱着Sai的Jerd和Noi决定帮助她战胜诅咒。','抔米提·米弯投瓦兰 Oabnithi Wiwattanawarang ,萨哈贾克·波斯安吉特, Phakwan Chaowalit , Ittipat Lekuthaiwan , Warinthorn Rattanasan, Makhasiri Thepsittha','2019-6-15 10:00:00','2019-7-11 10:00:00',7.2)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('只有爱能让我生存','/images/movie/alive.jpg','著名小说家，剧作家本谷友希子作品<活着，就是爱>将推出映画版，趣里&仲里依沙&菅田将晖共演。 故事围绕着患有过眠症的女主角和他恋人之间展开，新锐导演关根光才长篇映画出道作品，田中哲司、西田尚美、松重豊、石橋静河、織田梨沙共演。','菅田将晖 Masaki Suda ,仲里依纱 Riisa Naka ,田中哲司 Tetsushi Tanaka,西田尚美 Naomi Nishida, 松重丰 Yutaka Matsushige, Feynman, 石桥静河 Shizuka Ishibashi , 织田梨沙 ODA LISA','2019-2-21 10:00:00','2019-7-11 10:00:00',8.8)",
  "insert into movie(`name`,`imgUrl`,`describe`,`actor`,`start_time`,`end_time`,`score`) VALUES ('反贪风暴4','images/movie/P_Storm.jpg','廉政公署收到报案人廖雨萍（周秀娜饰）的实名举报，举报正在坐牢的富二代曹元元（林峯饰）涉嫌行贿监狱里的监督沈济全（谭耀文饰）以及惩教员，首席调查主任陆志廉（古天乐饰）决定深入虎穴，卧底狱中。在监狱里，被陆志廉送入监狱的前警司黄文彬（林家栋饰）以及曹元元两大帮派势成水火，陆志廉趁机接近曹元元取得信任。同时监狱外的廉政公署总调查主任程德明（郑嘉颖饰）、国内反贪局行动处处长洪亮（丁海峰饰）也陆港联手，通力合作，最终成功破获贪腐行贿大案','古天乐,郑嘉颖,林峯,林家栋,周秀娜,张智霖','2019-04-04 12:00:00','2020-04-04 12:00:00',9.4)"
  
